import requests

import urllib.parse

from bs4 import BeautifulSoup

domain = 'https://www.indiatoday.in/news.html'

try:
    response = requests.get(domain)
except:
    print("no response")

soup = BeautifulSoup(response.text, 'lxml')

links = soup.findAll('a')

p = open('links.txt', 'w')

for link in links:
    # print(link)
    p.write('\''+urllib.parse.urljoin(domain, link.get('href'))+'\''+',')

p.close()
